import { Link } from 'react-router-dom';

class Linker extends Component {
    render() { 
        return (
            <div className='linkers'>
                <ul>
                <li><Link to ="https://twitter.com/austynomilan" id='twitter'>Twitter</Link></li>
                <li><Link to ="https://training.zuri.team/">Zuri Team</Link></li>
                <li><Link to ="https://books.zuri.team/">Zuri Books</Link></li>
                <li><Link to ="https://books.zuri.team/">Python Books</Link></li>
                <li><Link to ="https://background.zuri.team">Background Check For Codes</Link></li>
                <li><Link to ="https://books.zuri.team/design-rules">Design Books</Link></li>
            </ul>
            </div>
        );
    }
}
 
export default Linker;
